import React from 'react';
import styled from 'styled-components';

const ImgItem = styled.div`
    width: 256px;
    height: 256px;
    border: 1px solid pink;
    margin-left: 2px;
`;

const ListItem = () => {
    return (
        <ImgItem />
    );
};

export default ListItem;
